import React from 'react';
import './App.css';
import AlertButton from './AlertButton';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My React TypeScript App</h1>
        <AlertButton alertMessage="Hello, World!" />
      </header>
    </div>
  );
}

export default App;
